import React, { useState, useEffect } from 'react';
import Modal from './Modal';

const defaultUser = {
  full_name: '',
  email: '',
  password: '',
  phone_number: '',
  role: 'parttime',
  is_active: true,
};

function UserForm({ isOpen, onClose, onSave, initialData }) {
  const [userData, setUserData] = useState(defaultUser);

  useEffect(() => {
    if (isOpen) {
      setUserData(initialData || defaultUser);
    }
  }, [initialData, isOpen]);

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setUserData((prev) => ({
      ...prev,
      [name]: type === 'checkbox' ? checked : value,
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    onSave(userData);
  };

  return (
    <Modal isOpen={isOpen} onClose={onClose}>
      <div className="modal-body">
        <form className="modal-form" onSubmit={handleSubmit}>
          <h3 style={{ marginBottom: '20px' }}>
            {initialData ? 'Edit User' : 'Add New User'}
          </h3>

          {/* Full name */}
          <div className="form-group">
            <label htmlFor="full_name">Full Name:</label>
            <input
              type="text"
              id="full_name"
              name="full_name"
              value={userData.full_name}
              onChange={handleChange}
              className="form-control"
              required
            />
          </div>

          {/* Email + Password chỉ khi tạo mới */}
          {!initialData && (
            <>
              <div className="form-group">
                <label htmlFor="email">Email:</label>
                <input
                  type="email"
                  id="email"
                  name="email"
                  value={userData.email}
                  onChange={handleChange}
                  className="form-control"
                  required
                />
              </div>

              <div className="form-group">
                <label htmlFor="password">Password:</label>
                <input
                  type="password"
                  id="password"
                  name="password"
                  value={userData.password}
                  onChange={handleChange}
                  className="form-control"
                  required
                />
              </div>
            </>
          )}

          {/* Phone */}
          <div className="form-group">
            <label htmlFor="phone_number">Phone Number:</label>
            <input
              type="tel"
              id="phone_number"
              name="phone_number"
              value={userData.phone_number}
              onChange={handleChange}
              className="form-control"
              pattern="[0-9]*"
            />
          </div>

          {/* Role */}
          <div className="form-group">
            <label htmlFor="role">Role:</label>
            <select
              id="role"
              name="role"
              value={userData.role}
              onChange={handleChange}
              className="form-control"
            >
              <option value="parttime">Part-time</option>
              <option value="supervisor">Supervisor</option>
              <option value="admin">Admin</option>
            </select>
          </div>

          {/* Active */}
          <div className="form-group" style={{ display: 'flex', alignItems: 'center' }}>
            <input
              type="checkbox"
              id="is_active"
              name="is_active"
              checked={userData.is_active}
              onChange={handleChange}
              style={{ marginRight: '10px' }}
            />
            <label htmlFor="is_active" style={{ marginBottom: 0, fontWeight: 'normal' }}>
              User is Active
            </label>
          </div>

          {/* Actions */}
          <div className="modal-actions">
            <button type="button" onClick={onClose} className="btn btn-danger">
              Cancel
            </button>
            <button type="submit" className="btn btn-primary">
              Save
            </button>
          </div>
        </form>
      </div>
    </Modal>
  );
}

export default UserForm;
